import React from 'react'
import NavBar from "../components/NavBar";
import Hero from '../components/Hero';
import Footer from '../components/Footer';
import Onoo from '../components/Onoo';

function Ono ()  {
  return (
    <>
    <NavBar/>
    {/* <Hero
      propsName="onoHero"
      heroImg="https://onomeals.zeusjones.com/images/Ono_Hero_2.jpg"
      url="/Ono"
    /> */}
    <Onoo/>
    <Footer/>
    </>
  )
}

export default Ono;
